class Solution {
public:

    bool dfs(vector<vector<int>> &graph, int curr_node, int curr_node_color, vector<int>& visited, vector<int>& color) {
        visited[curr_node] = 1;
        color[curr_node] = curr_node_color;
        
        for(auto neighbour: graph[curr_node]) {
            if(visited[neighbour] == 1) {
                if(color[neighbour] == curr_node_color) return false;
            }
            else {
                // if neighbour has not been visited // then go and visit
                if(dfs(graph, neighbour, 1 - curr_node_color, visited, color) == false) return false;
            }
        }
        return true;
    }

	bool isBipartite(vector<vector<int>>& graph) {  
        int n = graph.size();
        vector<int> visited(n, 0);
        vector<int> color(n, -1);
        for(int i=0;i<n;i++) {
            if(visited[i] == 0) {
                if(dfs(graph, i, 0, visited, color) == false) {
                    return false;
                }
            }
        }
        return true;
	}
};

